import React, { useState } from "react";
import Task from "./Task";

export function TaskList(props) {
  return (
    <div className="taskListContainer">
      <ul>
        {props.tasks.map((task) => (
          <li>
            <Task tasks={props.tasks} />
          </li>
        ))}
      </ul>
    </div>
  );
}
